import React, { useState, useEffect } from "react";
import axios from 'axios'
import { useHistory } from 'react-router';
const Cars = () => {

    const [cars, seteCars] = useState([])
    const history = useHistory()

    const getCars = async () => {
        const response = await axios.get('http://127.0.0.1:8000/list/')
        seteCars(response.data)
        console.log(response.data)


    }
    useEffect(() => {
        getCars();

    })





    return (

        <div>

            <h1 className='title'> Cars List</h1>


            <div className="cars-desc">
                {
                    cars.map((car, index) => (

                            <div key={index} >



                                <div class="container d-flex justify-content-center mt-50 mb-50">
                                    <div class="row">
                                        <div class="col-md-4 mt-2">
                                            <div class="card">
                                                <div class="card-body">
                                                    <div class="card-img-actions"> <img src={car.image} class="card-img img-fluid" width="150" height="200" alt="" /> </div>
                                                </div>
                                                <div class="card-body bg-light text-center">
                                                    <div class="mb-2">
                                                        <h6 class="font-weight-semibold mb-2"> <h2>{car.model}</h2>
                                                            <h4> {car.serie}</h4>
                                                            <p className="card-text ">Year: {car.year}</p>
                                                            <p className="card-text">Date creation Pub: {car.date}</p>
                                                            <p className="card-text">Dscription: {car.description}</p></h6>
                                                    </div>
                                                    <h3 class="mb-0 font-weight-semibold">Price: {car.price}</h3>
                                                    <div> <i class="fa fa-star star"></i> <i class="fa fa-star star"></i> <i class="fa fa-star star"></i> <i class="fa fa-star star"></i> </div>
                                                    <div class="text-muted mb-3">34 reviews</div> <button type="button" class="btn bg-cart"><i class="fa fa-cart-plus mr-2"></i> View detail</button>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                </div>

                            </div>


                    ))
                }
            </div>

        </div>


    );

};
export default Cars;
